import React, { useState } from "react";
import { 
    Box, Card, TextField, Typography, Button, IconButton 
} from "@mui/material";
import { Facebook, Google, Lock, Mail, Person } from "@mui/icons-material";
import { useNavigate } from "react-router-dom";
import { getAuth, createUserWithEmailAndPassword, signInWithPopup, GoogleAuthProvider, FacebookAuthProvider, updateProfile } from "firebase/auth";
import { useAuth } from "../context/AuthContext";

const RegisterPage = () => {
    const navigate = useNavigate();
    const auth = getAuth();
    const { currentUser } = useAuth(); // Get user authentication state

    const [name, setName] = useState("");
    const [email, setEmail] = useState("");
    const [password, setPassword] = useState("");
    const [error, setError] = useState("");
    const [loading, setLoading] = useState(false);

    // Signup with email & password
    const handleSignup = async () => {
        if (!name || !email || !password) {
            setError("Please fill in all fields.");
            return;
        }

        try {
            setLoading(true);
            const userCredential = await createUserWithEmailAndPassword(auth, email, password);
            const user = userCredential.user;

            // Update user profile with name
            await updateProfile(user, { displayName: name });

            alert("Signup Successful!");
            navigate("/resources");
        } catch (error) {
            setError(error.message);
        } finally {
            setLoading(false);
        }
    };

    // Signup with Google
    const handleGoogleSignup = async () => {
        try {
            const provider = new GoogleAuthProvider();
            await signInWithPopup(auth, provider);
            alert("Google Signup Successful!");
            navigate("/resources");
        } catch (error) {
            setError(error.message);
        }
    };

    // Signup with Facebook
    const handleFacebookSignup = async () => {
        try {
            const provider = new FacebookAuthProvider();
            await signInWithPopup(auth, provider);
            alert("Facebook Signup Successful!");
            navigate("/resources");
        } catch (error) {
            setError(error.message);
        }
    };

    return (
        <Box sx={{ display: "flex", justifyContent: "center", alignItems: "center", height: "100vh", backgroundColor: "#E3F2FD" }}>
            <Card sx={{ width: 350, padding: 4, borderRadius: 4, boxShadow: 3 }}>
                <Box sx={{ display: "flex", justifyContent: "center", marginBottom: 2 }}>
                    <img src="/images/signup.jpg" alt="Sign Up" style={{ width: 170 }} />
                </Box>
                <Typography variant="h5" fontWeight="bold" textAlign="center" gutterBottom>
                    Sign Up
                </Typography>

                {/*  Display Error Message if any */}
                {error && (
                    <Typography color="error" variant="body2" textAlign="center" sx={{ marginBottom: 2 }}>
                        {error}
                    </Typography>
                )}

                <TextField
                    fullWidth
                    variant="outlined"
                    placeholder="Full Name"
                    sx={{ marginBottom: 2 }}
                    InputProps={{ startAdornment: <Person sx={{ color: "#757575", marginRight: 1 }} /> }}
                    value={name}
                    onChange={(e) => setName(e.target.value)}
                />
                <TextField
                    fullWidth
                    variant="outlined"
                    placeholder="Email"
                    sx={{ marginBottom: 2 }}
                    InputProps={{ startAdornment: <Mail sx={{ color: "#757575", marginRight: 1 }} /> }}
                    value={email}
                    onChange={(e) => setEmail(e.target.value)}
                />
                <TextField
                    fullWidth
                    variant="outlined"
                    placeholder="Password"
                    type="password"
                    sx={{ marginBottom: 2 }}
                    InputProps={{ startAdornment: <Lock sx={{ color: "#757575", marginRight: 1 }} /> }}
                    value={password}
                    onChange={(e) => setPassword(e.target.value)}
                />

                <Button
                    fullWidth
                    variant="contained"
                    sx={{ backgroundColor: "#2196F3", color: "white", fontWeight: "bold", borderRadius: 2, marginY: 2 }}
                    onClick={handleSignup}
                    disabled={loading}
                >
                    {loading ? "SIGNING UP..." : "SIGN UP"}
                </Button>

                <Box display="flex" justifyContent="center" gap={2} marginTop={1}>
                    <IconButton sx={{ color: "#1877F2" }} onClick={handleFacebookSignup}>
                        <Facebook />
                    </IconButton>
                    <IconButton sx={{ color: "#4285F4" }} onClick={handleGoogleSignup}>
                        <Google />
                    </IconButton>
                </Box>

                <Typography
                    variant="body2"
                    textAlign="center"
                    sx={{ marginTop: 2, color: "#0288D1", cursor: "pointer" }}
                    onClick={() => navigate("/login")}
                >
                    Login with Email
                </Typography>
            </Card>
        </Box>
    );
};

export default RegisterPage;
